import "./about.css";

function About() {
  return (
    <div className="about">
      <h1>System created by</h1>
      <h4>Dave "Coding Guru" Smith</h4>

      <img src="/images/aboutpg.jpg" alt="" />
    </div>
  );
}

export default About;
